    return HANDLER_ERROR;
}

if (buffer_is_empty(p->conf.secret)) {
    log_trace("%s.%d: (error) secdownload.secret has to be set: %s", remove_path("src/mod_secure_download.c"), 213, "");
    return HANDLER_ERROR;
}

